import React from 'react'
import './landingpage.css'
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import Phone from '../assets/portfolio-20201008.jpeg'

const Screens = (props) => {
    const responsive = {
        desktop: {
          breakpoint: { max: 3000, min: 1024 },
          items: 3,
          slidesToSlide: 1 // optional, default to 1.
        },
        tablet: {
          breakpoint: { max: 1024, min: 464 },
          items: 2,
          slidesToSlide: 2 // optional, default to 1.
        },
        mobile: {
          breakpoint: { max: 464, min: 0 },
          items: 1,
          slidesToSlide: 1 // optional, default to 1.
        }
      };
    return(
        <div className='Screens'>
            <div className='screens-title robo900'>Trade 24/7 <br />365 days a year</div>
            <Carousel
                swipeable={true}
                draggable={true}
                showDots={true}
                responsive={responsive}
                ssr={true} // means to render carousel on server-side.
                infinite={true}
                autoPlay={true}
                autoPlaySpeed={100}
                keyBoardControl={true}
                customTransition="all .5"
                transitionDuration={100}
                containerClass="carousel-container"
                removeArrowOnDeviceType={["tablet", "mobile"]}
                deviceType={responsive}
                dotListClass="custom-dot-list-style"
            >
                <div>
                    <img
                    className="screens-img"
                    src={Phone}
                    alt="First slide"
                    />
                    <p className="caption robo400">Keep track of your shares and win payouts on the portfolio page.</p>
                </div>
                <div>
                    <img
                    className="screens-img"
                    src={Phone}
                    alt="First slide"
                    />
                    <p className="caption robo400">xyz</p>
                </div>
                <div>
                    <img
                    className="screens-img"
                    src={Phone}
                    alt="First slide"
                    />
                    <p className="caption robo400">fgswin payouts on the portfolio page.</p>
                </div>
                <div>
                    <img
                    className="screens-img"
                    src={Phone}
                    alt="First slide"
                    />
                    <p className="caption robo400">Kegsfortfolio page.</p>
                </div>
            </Carousel>;
        </div>
    )
}

export default Screens
